INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 0.0, 1, 0, "キャル", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 7001, 1, 106001, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 0.0, 1, 0, "コッコロ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 7002, 1, 105901, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 0.0, 1, 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 7003, 1, 105801, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 0.0, 1, 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 10001, 1, 105801, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 0.0, 1, 0, "キャル", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 10002, 1, 106001, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 0.0, 1, 0, "コッコロ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 10003, 1, 105901, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (10, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 1, 0.0, 1, 0, "シェフィ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 10004, 2, 106401, 2104010, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 0.0, 1, 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 12001, 1, 105801, 0, -416.5);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 0.0, 1, 0, "キャル", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 13001, 1, 106001, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 0.0, 1, 0, "コッコロ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 13002, 1, 105901, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 1, 0.0, 1, 0, "シェフィ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 13003, 2, 106401, 2104010, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 0.0, 1, 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 13004, 1, 105801, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 0.0, 1, 0, "コッコロ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 14001, 1, 105901, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 1, 0.0, 1, 0, "シェフィ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 14002, 2, 106401, 2104010, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 0.0, 1, 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 14003, 1, 105801, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 0.0, 1, 0, "キャル", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 14004, 1, 106001, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 0.0, 1, 0, "コッコロ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 15001, 1, 105901, 0, -470.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 1, 0.0, 1, 0, "シェフィ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 16001, 2, 106401, 2104010, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 0.0, 1, 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 16002, 1, 105801, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 0.0, 1, 0, "キャル", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 16003, 1, 106001, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 0.0, 1, 0, "コッコロ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 16004, 1, 105901, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 0.0, 1, 0, "コッコロ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 17002, 1, 105901, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (25, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 0.0, 1, 0, "キャル", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 17004, 1, 106001, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (25, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 0.0, 1, 0, "コッコロ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 17005, 1, 105901, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (25, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 1, 0.0, 1, 0, "シェフィ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 17006, 2, 106401, 2104010, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (25, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 0.0, 1, 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 17007, 1, 105801, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (18, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 0.0, 1, 0, "カリン", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 18001, 1, 190801, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (18, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 1, 0.0, 2, 0, "カリン", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 18002, 1, 190801, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (19, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 1, 0.0, 3, 0, "カリン", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 19001, 1, 190801, 0, -470.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (19, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, 0.0, 4, 0, "カリン", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 19002, 1, 190801, 0, -470.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (20, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, 0.0, 5, 0, "カリン", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 20001, 1, 190801, 0, -470.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (20, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, 0.0, 6, 0, "カリン", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 20002, 1, 190801, 0, -470.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 0.0, 1, 0, "キャル", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 21001, 1, 106001, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (21, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 0.0, 1, 0, "コッコロ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 21002, 1, 105901, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (21, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 1, 0.0, 1, 0, "シェフィ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 21003, 2, 106401, 2104010, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (21, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 0.0, 1, 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 21004, 1, 105801, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (22, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 0.0, 1, 0, "カリン", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 22001, 1, 190801, 0, -430.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (22, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, 0.0, 2, 0, "カリン", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 22002, 1, 190801, 0, -430.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (23, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, 0.0, 3, 0, "カリン", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 23001, 1, 190801, 0, -430.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, 0.0, 4, 0, "カリン", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 23002, 1, 190801, 0, -430.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 2, 4.08, 1, 10011, "エリコ（バレンタイン）", 8.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24001, 1, 109001, 0, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, 5.0, 2, 10011, "エリコ（バレンタイン）", 8.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24002, 1, 109001, 0, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 2, 10.11, 3, 10011, "エリコ（バレンタイン）", 8.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24003, 1, 109001, 0, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 2, 4.0, 4, 10011, "エリコ（バレンタイン）", 8.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24004, 1, 109001, 0, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 2, 6.0, 5, 10011, "エリコ（バレンタイン）", 8.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24005, 1, 109001, 0, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, 0.0, 6, 10011, "エリコ（バレンタイン）", 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24006, 1, 109002, 0, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, 0.0, 7, 10011, "エリコ（バレンタイン）", 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24007, 1, 109002, 0, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, 0.0, 8, 10011, "エリコ（バレンタイン）", 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24008, 1, 109002, 0, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, 0.0, 9, 10011, "エリコ（バレンタイン）", 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24009, 1, 109002, 0, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, 0.0, 10, 10011, "エリコ（バレンタイン）", 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24010, 1, 109002, 0, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 2, 2.12, 1, 10011, "シズル（バレンタイン）", 8.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24011, 1, 109101, 0, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, 4.19, 2, 10011, "シズル（バレンタイン）", 8.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24012, 5, 109101, 0, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 4, 2.3, 3, 10011, "シズル（バレンタイン）", 8.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24013, 2, 109101, 0, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, 0.0, 4, 10011, "シズル（バレンタイン）", 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24014, 1, 109102, 0, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 2, 5.23, 5, 10011, "シズル（バレンタイン）", 8.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24015, 5, 109101, 0, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, 0.0, 6, 10011, "シズル（バレンタイン）", 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24016, 1, 109102, 0, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 2, 5.01, 7, 10011, "シズル（バレンタイン）", 8.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24017, 1, 109101, 0, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, 0.0, 8, 10011, "シズル（バレンタイン）", 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24018, 1, 109102, 0, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, 0.0, 9, 10011, "シズル（バレンタイン）", 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24019, 1, 109102, 0, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (24, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, 0.0, 10, 10011, "シズル（バレンタイン）", 0.0, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 24020, 1, 109102, 0, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (26, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 1, 0.0, 1, 0, "シェフィ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 26001, 2, 106401, 2104010, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (26, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 1, 0.0, 1, 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 26002, 1, 105801, 0, -363.0);
