INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (26, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 1, 0.0, 1, 0, "コッコロ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 26004, 1, 105901, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (27, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 1, 0.0, 1, 0, "シェフィ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 27001, 2, 106401, 2104010, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (27, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 1, 0.0, 1, 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 27002, 1, 105801, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (27, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 1, 0.0, 1, 0, "キャル", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 27003, 1, 106001, 0, -363.0);
