INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (41, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 1, 0.0, 1, 0, "シェフィ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 41001, 1, 106401, 2104010, -363.0);
