INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (43, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 1, 0.0, 1, 0, "ペコリーヌ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 43001, 1, 105801, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (43, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 1, 0.0, 1, 0, "コッコロ", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 43002, 1, 105901, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (43, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, 0.0, 1, 0, "キャル", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 43003, 1, 106001, 0, -363.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (44, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 1, 0.0, 1, 0, "アメス", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 43004, 1, 123001, 0, -416.5);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (44, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 1, 0.0, 2, 0, "アメス", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 43005, 1, 123001, 0, -416.5);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (45, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 2, 5.79, 3, 0, "アメス", 0.0, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 43006, 1, 123001, 0, -416.5);
